import React, { Component } from "react";
import "reactjs-popup/dist/index.css";
import Modal from "react-modal";
import "./AddVoucherModal.css";

const customStyles = {
  content: {
    top: "50%",
    left: "50%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
  },
};

export default class AddVoucherModal extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  afterOpenModal() {
    var a = this.state.subtitle;
    a.style.color = "#f00";
    a.style.width = "500px";
    a.style.height = "500px";
    this.setState({ subtitle: a });
  }
  closeModal() {
    this.props.closeModal();
  }
  async componentDidMount() {}

  render() {
    return (
      <Modal
        isOpen={this.props.showModal}
        onRequestClose={this.closeModal.bind(this)}
        style={customStyles}
        afterOpenModal={this.afterOpenModal.bind(this)}
        contentLabel="Example Modal"
      >
         <div className="">

          <div className="styles__StyledCouponInput-sc-1jz9vfn-0 ">

          <div class="modal-dialog modal-dialog-centered" role="document">
        <div class="modal-content">
          <div class="modal-header">
            <h5 class="modal-title" id="exampleModalLongTitle">
              {this.props.title}
            </h5>
          </div>
          <div class="modal-body">{this.props.children}</div>
          <div class="modal-footer">
            <button
              type="button"
              class="btn btn-secondary"
              data-dismiss="modal"
              onClick={this.props.handleClose}
            >
              Đóng
            </button>
            <button type="button" class="btn btn-primary" onClick={this.props.handleSave}>
              Lưu thay đổi
            </button>
          </div>
        </div>
      </div>
          </div>


        </div>
      </Modal>
    );
  }
}
